 import { Fragment } from "react";




function App() {
  return (
    <Fragment>
    <h1>Administrador de pacientes</h1>
    <div className="container">

    <div className="row">
      <div className="one-half column"></div>
      1
    </div>

      <div className="one-half column"></div>
      2
    </div>
    </Fragment>
  );
}

export default App;
